import osimport djangofrom redis_client.redis_client import redis_clientfrom stores.Auchan.auchan_info import AUCHAN_ARTICLESfrom stores.Auchan.auchan_model import AuchanStorefrom stores.Auchan.locators import AuchanLocatoros.environ.setdefault("DJANGO_SETTINGS_MODULE", "scraper.settings")django.setup()from items.models import Itemdef start_auchan_wacom():    auchan = AuchanStore(url=AuchanLocator.WACOM_PAGE_URL)    items = auchan.generate_info()    result = auchan.compare_data_xp_pen(partner_items_list=items,                                        article_dict=AUCHAN_ARTICLES,                                        model=Item)    data = redis_client.transfer_to_json(result)    redis_client.save_data_in_redis(name='auchan', value=data)    return result